import React, { useEffect } from 'react';
import Avatar from '@material-ui/core/Avatar';
import CssBaseline from '@material-ui/core/CssBaseline';
import Typography from '@material-ui/core/Typography';
import Container from '@material-ui/core/Container';
import { dataMateria } from '../../../home';
import { useStyles } from './dialogos_principal';
import 'jspdf-autotable';
import { ButtonPdf } from './btn_Pdf';

var nombre = '',
	  clave = '',
    division = '';
    
export default function ComposedTextField() {
  const classes = useStyles();
  
	useEffect(() => {
		try {
			nombre = dataMateria[0].nameDocente;
			clave = dataMateria[0].clavePersonal;
			division = dataMateria[0].nombreCorto;
		} catch (error) {}
	},[]);

	return (
		<React.Fragment>
			<CssBaseline />
			<Container maxWidth="sm">
				<div className={classes.avatar}>
					<Avatar src="/broken-image.jpg" />
				</div>
				<Typography variant="button" display="block" gutterBottom>
					<strong>Nombre:</strong> {nombre}
				</Typography>
				<Typography variant="button" display="block" gutterBottom>
					<strong>Clave:</strong> {clave}
				</Typography>
				<Typography variant="button" display="block" gutterBottom>
					<strong>Divisi√≥n:</strong> {division}
				</Typography>
				<div className={classes.pdfss}>
					<ButtonPdf />
				</div>
			</Container>
		</React.Fragment>
	);
}
